import React, { Component } from "react";

class List extends Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      users: []
    };
  }

  render() {
    const text = this.state.loading
      ? "loading..."
      : this.state.users.map(user => {
          return <p>{user.Name}</p>;
        });
    return;
    <table id="list">
      <thead>
        <tr class="head-row">
          <th>First name</th>
          <th>Last name</th>
          <th>House</th>
          <th>Status</th>
          <th>Blood</th>
          <th>Details</th>
        </tr>
      </thead>
      <tbody>{text}</tbody>
    </table>;
  }
}

export default List;
